import React from "react";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import "../../App.css";

function LocalNav() {
	const navigate = useNavigate();

	const onClickButton = () => {
		// detail page 이동
		navigate("detail");
	};
	return <LocalNavContainer>Post Your Food</LocalNavContainer>;
}
export default LocalNav;

const LocalNavContainer = styled.div`
	display: flex;
	align-items: center;
	height: 200px;
	font-size: 70px;
	font: "KBO-Dia-Gothic_bold";
`;
